import axios from "axios";
import config from "./config"; // assuming your base URL is in config.url

const fetchAnalysis = async (payload) => {
  try {
    const response = await axios.post(
      `${config.url}/palpitation_analysis`,
      payload,
      {
        headers: {
          "Content-Type": "application/json"
        }
      }
    );
    console.log(response.data);
  } catch (error) {
    console.error(error);
  }
};
